import React from 'react'; // Import the Component component from React

function Slide(props) {
  return(
    <div className="slide">
      <div className = "slide-imgWrapper">
        <img className="slide-img" src={props.image}/>
      </div>
      <div className="slide-textWrapper">
        <h1>{props.section}</h1>
        <h2>{props.title}</h2>
        <h3>{props.text}</h3>
      </div>
    </div>
  )
}

export default Slide;
